pragma solidity ^0.4.18;

import "./ConvertLib.sol";

contract Donations {
    address public poolAddress = 0xf17f52151EbEF6C7334FAD080c5704D77216b732;
    address public owner;
    address public sender;

    mapping (address => uint) balances;

    event Donate(address from, uint256 amount);

    modifier onlyOwner() {
        require(msg.sender == owner);
        _;
    }

     function kill() public onlyOwner {
        selfdestruct(owner);
    }

    function Donations() public {
		owner = msg.sender;
	}

	function sendDonation(uint amount) public returns(bool sufficient) {
		if (balances[msg.sender] < amount) {
            return false;
        }
        if (msg.sender == poolAddress) {
            return false;
        }
		balances[msg.sender] -= amount;
		balances[poolAddress] += amount;
		Donate(msg.sender, amount);
		return true;
	}

	function getPoolBalanceInEth() public view returns(uint) {
		return ConvertLib.convert(getBalance(poolAddress),2);
	}

    function getBalance(address addr) public view returns(uint) {
		return balances[addr];
	}

}
